import { JSXElementConstructor, ReactElement, ReactFragment, useState } from 'react';
import './App.css'
import Botao from './Botao';








function App() {
  const Numeros = Array.from({ length: 25 }, (e, i) => i + 1).sort(() => Math.random() - 0.5).filter((e, i) => i < 15);
  const listaNumeros: string | number | boolean | ReactElement<any, string | JSXElementConstructor<any>> | ReactFragment | null | undefined = []





return (
  <div>
    <div>
      {listaNumeros}
    </div>
    <Botao onClick={()=>Numeros.map(
  (e,i)=><div key={i}>{e}</div>)
}>Gerar</Botao>  
    </div>
)

}

export default App;
